# ================ Diffusion Schedule ================
if config.beta_schedule == "linear":
    betas = torch.linspace(1e-4, 0.02, config.timesteps)
elif config.beta_schedule == "cosine":
    # Improved schedule from "Improved Denoising Diffusion Probabilistic Models"
    s = 0.008
    steps = config.timesteps + 1
    x = torch.linspace(0, config.timesteps, steps)
    alphas_cumprod = torch.cos(((x / config.timesteps) + s) / (1 + s) * math.pi * 0.5) ** 2
    alphas_cumprod = alphas_cumprod / alphas_cumprod[0]
    betas = 1 - (alphas_cumprod[1:] / alphas_cumprod[:-1])
    betas = torch.clip(betas, 0, 0.999)
else:
    raise ValueError(f"Unknown beta schedule: {config.beta_schedule}")

alphas = 1. - betas
alphas_cumprod = torch.cumprod(alphas, dim=0)
sqrt_alphas_cumprod = torch.sqrt(alphas_cumprod)
sqrt_one_minus_alphas_cumprod = torch.sqrt(1. - alphas_cumprod)

# Move to device later
betas = betas.to(device)
alphas = alphas.to(device)
alphas_cumprod = alphas_cumprod.to(device)
sqrt_alphas_cumprod = sqrt_alphas_cumprod.to(device)
sqrt_one_minus_alphas_cumprod = sqrt_one_minus_alphas_cumprod.to(device)

# ================ Dataset ================
class YelpCaptionedDataset(Dataset):
    def __init__(self, caption_csv, image_root, transform, tokenizer, max_samples_per_class=500):
        df = pd.read_csv(caption_csv)
        df = df[df["label"].isin(config.sample_labels)]

        # Balance classes
        print("\n▶ Original label distribution:")
        print(df["label"].value_counts())

        df = (df.groupby("label")
              .apply(lambda x: x.sample(n=min(max_samples_per_class, len(x)), random_state=42))
              .reset_index(drop=True))

        print(f"\n▶ Balanced sample ({max_samples_per_class} each):")
        print(df["label"].value_counts())

        self.df = df
        self.image_root = image_root
        self.transform = transform
        self.tokenizer = tokenizer

    def __len__(self):
        return len(self.df)

    def __getitem__(self, idx):
        row = self.df.iloc[idx]
        img_path = os.path.join(self.image_root, row["label"], f"{row['photo_id']}.jpg")

        if not os.path.exists(img_path):
            return self[(idx + 1) % len(self)]

        img = Image.open(img_path).convert("RGB")
        img = self.transform(img)

        toks = self.tokenizer(
            row["caption"],
            padding="max_length",
            truncation=True,
            max_length=77,
            return_tensors="pt"
        )
        return {
            "pixel_values": img,
            "input_ids": toks.input_ids.squeeze(0),
            "caption": row["caption"]
        }

# ================ Model Components ================
class SinusoidalPosEmb(nn.Module):
    def __init__(self, dim):
        super().__init__()
        self.dim = dim

    def forward(self, t):
        half_dim = self.dim // 2
        emb = math.log(10000) / (half_dim - 1)
        emb = torch.exp(torch.arange(half_dim, device=t.device) * -emb)
        emb = t[:, None] * emb[None, :]
        emb = torch.cat((emb.sin(), emb.cos()), dim=-1)
        return emb

class CrossAttention(nn.Module):
    def __init__(self, channels, text_dim, num_heads=8):
        super().__init__()
        self.norm = nn.GroupNorm(32, channels)
        self.attention = nn.MultiheadAttention(
            embed_dim=channels,
            kdim=text_dim,
            vdim=text_dim,
            num_heads=num_heads,
            batch_first=True
        )

    def forward(self, x, txt_emb):
        """ x: [B, C, H, W], txt_emb: [B, seq_len, text_dim] """
        B, C, H, W = x.shape
        residual = x

        # Normalize and reshape
        x = self.norm(x)
        x = x.view(B, C, -1).permute(0, 2, 1)  # [B, H*W, C]

        # Cross-attention
        attn_out, _ = self.attention(
            query=x,
            key=txt_emb,
            value=txt_emb
        )

        # Residual connection
        attn_out = attn_out.permute(0, 2, 1).view(B, C, H, W)
        return residual + attn_out

class ResBlock(nn.Module):
    def __init__(self, in_c, out_c, time_dim, text_dim, downsample=True):
        super().__init__()
        self.conv1 = nn.Sequential(
            nn.GroupNorm(32, in_c),
            nn.SiLU(),
            nn.Conv2d(in_c, out_c, 3, padding=1)
        )
        self.time_proj = nn.Linear(time_dim, out_c)
        self.conv2 = nn.Sequential(
            nn.GroupNorm(32, out_c),
            nn.SiLU(),
            nn.Conv2d(out_c, out_c, 3, padding=1)
        )
        self.attn = CrossAttention(out_c, text_dim) if in_c > 128 else None

        self.shortcut = nn.Identity()
        if in_c != out_c:
            self.shortcut = nn.Conv2d(in_c, out_c, 1)

        self.downsample = nn.Conv2d(out_c, out_c, 3, 2, 1) if downsample else None

    def forward(self, x, t_emb, txt_emb):
        residual = self.shortcut(x)

        x = self.conv1(x)
        t_proj = self.time_proj(t_emb)[:, :, None, None]
        x = x + t_proj
        x = self.conv2(x)

        if self.attn:
            x = self.attn(x, txt_emb)

        x = x + residual

        # Store output before downsampling for skip connection
        skip_out = x

        if self.downsample:
            x = self.downsample(x)

        return x, skip_out # Return both downsampled output and skip connection

class UNetWithCrossAttention(nn.Module):
    def __init__(self):
        super().__init__()
        # Time embedding
        self.time_mlp = nn.Sequential(
            SinusoidalPosEmb(config.time_embed_dim),
            nn.Linear(config.time_embed_dim, config.time_embed_dim * 4),
            nn.SiLU(),
            nn.Linear(config.time_embed_dim * 4, config.time_embed_dim)
        )

        # Initial convolution
        self.init_conv = nn.Conv2d(4, 64, 3, padding=1)

        # Downsample blocks
        self.down1 = ResBlock(64, 128, config.time_embed_dim, config.text_embed_dim)
        self.down2 = ResBlock(128, 256, config.time_embed_dim, config.text_embed_dim)
        self.down3 = ResBlock(256, 512, config.time_embed_dim, config.text_embed_dim)

        # Middle blocks
        self.mid_block1 = ResBlock(512, 512, config.time_embed_dim, config.text_embed_dim, downsample=False)
        self.mid_attn = CrossAttention(512, config.text_embed_dim)
        self.mid_block2 = ResBlock(512, 512, config.time_embed_dim, config.text_embed_dim, downsample=False)

        # Upsample blocks
        # These blocks will receive concatenated input from upsampled features and skip connections
        self.up1 = ResBlock(512 + 512, 256, config.time_embed_dim, config.text_embed_dim, downsample=False)
        self.up2 = ResBlock(256 + 256, 128, config.time_embed_dim, config.text_embed_dim, downsample=False)
        self.up3 = ResBlock(128 + 128, 64, config.time_embed_dim, config.text_embed_dim, downsample=False)


        # Output
        self.out_norm = nn.GroupNorm(32, 64)
        self.out_conv = nn.Conv2d(64, 4, 3, padding=1)

    def forward(self, x, t, txt_emb):
        t_emb = self.time_mlp(t)

        # Initial
        x = self.init_conv(x)
        skip = []

        # Downsample
        x, skip1 = self.down1(x, t_emb, txt_emb)
        skip.append(skip1)
        x, skip2 = self.down2(x, t_emb, txt_emb)
        skip.append(skip2)
        x, skip3 = self.down3(x, t_emb, txt_emb)
        skip.append(skip3)

        # Middle
        x, _ = self.mid_block1(x, t_emb, txt_emb) # Mid blocks don't downsample, skip output not needed
        x = self.mid_attn(x, txt_emb)
        x, _ = self.mid_block2(x, t_emb, txt_emb) # Mid blocks don't downsample, skip output not needed


        # Upsample
        x = F.interpolate(x, scale_factor=2, mode="nearest")
        x = torch.cat([x, skip.pop()], dim=1) # Use skip from down3
        x, _ = self.up1(x, t_emb, txt_emb)

        x = F.interpolate(x, scale_factor=2, mode="nearest")
        x = torch.cat([x, skip.pop()], dim=1) # Use skip from down2
        x, _ = self.up2(x, t_emb, txt_emb)

        x = F.interpolate(x, scale_factor=2, mode="nearest")
        x = torch.cat([x, skip.pop()], dim=1) # Use skip from down1
        x, _ = self.up3(x, t_emb, txt_emb)

        # Output
        x = self.out_norm(x)
        x = F.silu(x)
        return self.out_conv(x)

# ================ Diffusion Helpers ================
def q_sample(z0, t, noise):
    """Forward diffusion in latent space"""
    sqrt_alpha_cumprod = sqrt_alphas_cumprod[t][:, None, None, None]
    sqrt_one_minus_alpha = sqrt_one_minus_alphas_cumprod[t][:, None, None, None]
    return sqrt_alpha_cumprod * z0 + sqrt_one_minus_alpha * noise

@torch.no_grad()
def p_sample(model, z, t, txt_emb):
    """Reverse diffusion step"""
    model.eval()
    t_batch = torch.full((z.size(0),), t, device=device, dtype=torch.long)
    pred_noise = model(z, t_batch.float(), txt_emb)

    alpha_t = alphas[t]
    alpha_cumprod_t = alphas_cumprod[t]
    beta_t = betas[t]

    # Predict x0 for better results
    pred_x0 = (z - torch.sqrt(1 - alpha_cumprod_t) * pred_noise) / torch.sqrt(alpha_cumprod_t)

    # Compute direction pointing to x_t
    eps = (z - torch.sqrt(alpha_cumprod_t) * pred_x0) / torch.sqrt(1 - alpha_cumprod_t)

    # Calculate mean of next z
    z_prev = torch.sqrt(alpha_cumprod_t) * pred_x0 + torch.sqrt(1 - alpha_cumprod_t) * eps

    # Add noise if not last step
    if t > 0:
        noise = torch.randn_like(z)
        z_prev = z_prev + torch.sqrt(beta_t) * noise

    return z_prev

@torch.no_grad()
def sample(model, tokenizer, text_encoder, prompt, steps=config.sample_steps, batch_size=1):
    """Generate image from text prompt"""
    model.eval()
    text_encoder.eval()

    # Tokenize and encode text
    text_input = tokenizer(
        [prompt] * batch_size,
        padding="max_length",
        truncation=True,
        max_length=77,
        return_tensors="pt"
    ).to(device)

    txt_emb = text_encoder(text_input.input_ids).last_hidden_state

    # Initial noise
    h = w = config.latent_size
    z = torch.randn(batch_size, 4, h, w, device=device)

    # Diffusion loop
    for t in tqdm(range(steps-1, -1, -1), desc="Sampling"):
        z = p_sample(model, z, t, txt_emb)

    # Decode latent
    imgs = vae.decode(z / 0.18215).sample
    return imgs.clamp(-1, 1)

# ================ Main Training ================
if __name__ == "__main__":
    # Setup
    transform = transforms.Compose([
        transforms.Resize((config.image_size, config.image_size)),
        transforms.ToTensor(),
        transforms.Normalize([0.5]*3, [0.5]*3)
    ])

    # Load models
    vae = AutoencoderKL.from_pretrained("stabilityai/sd-vae-ft-mse").to(device).eval()
    tokenizer = CLIPTokenizer.from_pretrained("openai/clip-vit-base-patch32")
    text_encoder = CLIPTextModel.from_pretrained("openai/clip-vit-base-patch32").to(device).eval()

    # Dataset
    full_ds = YelpCaptionedDataset(
        config.caption_file,
        config.image_dir,
        transform,
        tokenizer,
        max_samples_per_class=config.num_samples_per_class
    )

    val_size = int(config.val_split * len(full_ds))
    train_ds, val_ds = random_split(full_ds, [len(full_ds)-val_size, val_size])

    train_loader = DataLoader(train_ds, batch_size=config.batch_size, shuffle=True, num_workers=2)
    val_loader = DataLoader(val_ds, batch_size=config.batch_size, num_workers=2)

    # Model
    unet = UNetWithCrossAttention().to(device)
    optimizer = torch.optim.AdamW(unet.parameters(), lr=config.learning_rate)
    scheduler = torch.optim.lr_scheduler.CosineAnnealingLR(
        optimizer,
        T_max=config.num_epochs * len(train_loader),
        eta_min=1e-6
    )

    # Training loop
    best_val_loss = float('inf')

    for epoch in range(config.num_epochs):
        unet.train()
        epoch_loss = 0.0

        # Training
        for i, batch in enumerate(tqdm(train_loader, desc=f"Epoch {epoch+1}/{config.num_epochs}")):
            # Prepare data
            images = batch["pixel_values"].to(device)
            input_ids = batch["input_ids"].to(device)

            # Get latents and text embeddings
            with torch.no_grad():
                latents = vae.encode(images).latent_dist.sample() * 0.18215
                text_emb = text_encoder(input_ids).last_hidden_state

            # Diffusion process
            t = torch.randint(0, config.timesteps, (images.size(0),), device=device).long()
            noise = torch.randn_like(latents)
            noisy_latents = q_sample(latents, t, noise)

            # Predict noise
            pred_noise = unet(noisy_latents, t.float(), text_emb)
            loss = F.mse_loss(pred_noise, noise)

            # Optimize
            loss.backward()

            # Gradient accumulation
            if (i + 1) % config.grad_accum_steps == 0:
                optimizer.step()
                optimizer.zero_grad()
                scheduler.step()

            epoch_loss += loss.item()

        # Validation
        unet.eval()
        val_loss = 0.0
        with torch.no_grad():
            for val_batch in tqdm(val_loader, desc="Validating"):
                images = val_batch["pixel_values"].to(device)
                input_ids = val_batch["input_ids"].to(device)

                latents = vae.encode(images).latent_dist.sample() * 0.18215
                text_emb = text_encoder(input_ids).last_hidden_state

                t = torch.randint(0, config.timesteps, (images.size(0),), device=device).long()
                noise = torch.randn_like(latents)
                noisy_latents = q_sample(latents, t, noise)

                pred_noise = unet(noisy_latents, t.float(), text_emb)
                loss = F.mse_loss(pred_noise, noise)
                val_loss += loss.item()

        # Logging
        train_loss = epoch_loss / len(train_loader)
        val_loss = val_loss / len(val_loader)
        print(f"Epoch {epoch+1}/{config.num_epochs} | "
              f"Train Loss: {train_loss:.4f} | Val Loss: {val_loss:.4f} | "
              f"LR: {scheduler.get_last_lr()[0]:.2e}")

        # Save best model
        if val_loss < best_val_loss:
            best_val_loss = val_loss
            torch.save(unet.state_dict(), "best_crossattn_unet.pt")
            print(f"Saved new best model with val loss: {val_loss:.4f}")

            # Generate sample preview
            preview_captions = [val_ds[i]["caption"] for i in range(config.num_preview_samples)]
            preview_images = []

            for caption in preview_captions:
                img = sample(unet, tokenizer, text_encoder, caption, batch_size=1)
                preview_images.append(img)

            preview_grid = torch.cat(preview_images, dim=0)
            tv_utils.save_image(
                (preview_grid + 1) / 2,
                f"epoch_{epoch+1}_samples.png",
                nrow=config.num_preview_samples,
                normalize=True
            )

    # Final evaluation
    print("\nTraining completed. Starting final evaluation...")
    unet.load_state_dict(torch.load("best_crossattn_unet.pt"))
    unet.eval()

    # Prepare real images
    real_images = []
    gen_images = []
    captions = []

    for i in range(config.num_metric_samples):
        idx = torch.randint(0, len(val_ds), (1,)).item()
        real_images.append(val_ds[idx]["pixel_values"])
        captions.append(val_ds[idx]["caption"])

    real_images = torch.stack(real_images).to(device)

    # Generate images
    for i in tqdm(range(0, config.num_metric_samples, config.batch_size), desc="Generating images"):
        batch_captions = captions[i:i+config.batch_size]
        batch_size = len(batch_captions)

        # Tokenize batch
        text_input = tokenizer(
            batch_captions,
            padding="max_length",
            truncation=True,
            max_length=77,
            return_tensors="pt"
        ).to(device)

        # Get embeddings
        with torch.no_grad():
            txt_emb = text_encoder(text_input.input_ids).last_hidden_state

            # Generate latents
            h = w = config.latent_size
            z = torch.randn(batch_size, 4, h, w, device=device)

            # Diffusion loop
            for t in range(config.sample_steps-1, -1, -1):
                t_batch = torch.full((batch_size,), t, device=device, dtype=torch.long)
                pred_noise = unet(z, t_batch.float(), txt_emb)

                alpha_t = alphas[t]
                alpha_cumprod_t = alphas_cumprod[t]
                beta_t = betas[t]

                # Predict x0
                pred_x0 = (z - torch.sqrt(1 - alpha_cumprod_t) * pred_noise) / torch.sqrt(alpha_cumprod_t)

                # Compute direction
                eps = (z - torch.sqrt(alpha_cumprod_t) * pred_x0) / torch.sqrt(1 - alpha_cumprod_t)

                # Calculate mean of next z
                z = torch.sqrt(alpha_cumprod_t) * pred_x0 + torch.sqrt(1 - alpha_cumprod_t) * eps

                # Add noise if not last step
                if t > 0:
                    noise = torch.randn_like(z)
                    z = z + torch.sqrt(beta_t) * noise

            # Decode
            imgs = vae.decode(z / 0.18215).sample
            gen_images.append(imgs.cpu())

    gen_images = torch.cat(gen_images, dim=0)[:config.num_metric_samples]

    # Compute metrics
    fid = FrechetInceptionDistance(feature=2048, normalize=True).to(device)
    isc = InceptionScore(normalize=True).to(device)

    # Prepare images (convert to uint8)
    real_uint8 = (real_images * 0.5 + 0.5).mul(255).byte()
    gen_uint8 = (gen_images * 0.5 + 0.5).mul(255).byte().to(device) # <-- Move to device

    fid.update(real_uint8, real=True)
    fid.update(gen_uint8, real=False)
    isc.update(gen_uint8)

    fid_score = fid.compute().item()
    isc_mean, isc_std = isc.compute()

    print("\n" + "="*50)
    print(f"Final Evaluation Results:")
    print(f"FID Score: {fid_score:.3f}")
    print(f"Inception Score: {isc_mean:.3f} ± {isc_std:.3f}")
    print("="*50)

    # Save final preview
    preview_real = real_images[:config.num_preview_samples]
    preview_gen = gen_images[:config.num_preview_samples].to(device) # <-- Move to device for saving

    grid = torch.cat([preview_real, preview_gen], dim=0)
    tv_utils.save_image(
        (grid + 1) / 2,
        "final_comparison.png",
        nrow=config.num_preview_samples,
        normalize=True
    )
    print("Saved final comparison grid to final_comparison.png")